import { Component, Input, Output, EventEmitter } from '@angular/core';
import { ButtonModule } from 'primeng/button';

/**
 * Botão base da aplicação
 *
 * Baseado em PrimeNG e usado como átomo no Design System.
 */
@Component({
  selector: 'app-button',
  standalone: true,
  imports: [ButtonModule],
  templateUrl: './button.component.html',
  styleUrls: ['./button.component.scss'],
})
export class ButtonComponent {
  @Input() label = 'Botão';
  @Input() disabled = false;
  @Input() loading = false;

  @Input() variant: 'primary' | 'secondary' = 'primary';
  @Input() destructive = false;

  @Output() action = new EventEmitter<void>();

  get severity(): 'secondary' | 'danger' {
    return this.destructive ? 'danger' : 'secondary';
  }

  get outlined(): boolean {
    return this.variant === 'secondary';
  }

  get isDisabled(): boolean {
    return this.disabled || this.loading;
  }

  onClick(): void {
    if (this.isDisabled) return;
    this.action.emit();
  }
}

import { Component, Input } from '@angular/core';
import { CommonModule } from '@angular/common';
import { FormControl, ReactiveFormsModule } from '@angular/forms';

import { InputTextModule } from 'primeng/inputtext';
import { InputMaskModule } from 'primeng/inputmask';
import { FloatLabelModule } from 'primeng/floatlabel';

@Component({
  selector: 'app-form-input',
  standalone: true,
  imports: [
    CommonModule,
    ReactiveFormsModule,
    InputTextModule,
    InputMaskModule,
    FloatLabelModule
  ],
  templateUrl: './form-input.component.html',
  styleUrl: './form-input.component.scss'
})
export class FormInputComponent {
  @Input({ required: true }) control!: FormControl;

  @Input() label!: string;
  @Input() type: 'text' | 'post-code' | 'phone' = 'text';
  @Input() errorMessage = 'Campo inválido';

  get mask(): string {
    var maskFormat = "";

    switch(this.type) {
        case 'phone':
            maskFormat = '(99) 99999-9999';
            break;
        case 'post-code':
            maskFormat = '99999-999';
            break;
    }

    return maskFormat;
  }

  get hasError(): boolean {
    return this.control.invalid && this.control.touched;
  }
}

